import { Component, OnInit } from '@angular/core';
import { Router, NavigationExtras, ActivatedRoute } from '@angular/router';
import { AlertController, IonModal } from '@ionic/angular';
import { ViewChild } from '@angular/core'

@Component({
  selector: 'app-login',
  templateUrl: './login.page.html',
  styleUrls: ['./login.page.scss'],
})
export class LoginPage implements OnInit {
  @ViewChild(IonModal) modal!: IonModal;

  constructor(private router: Router, private activatedRouter: ActivatedRoute, public alertController: AlertController) { }

  public mensaje = "";

  public alertButtons = ['OK'];
  public user = {
    usuario: "",
    password: ""
  }
  public informacion = {
    nombre: "",
    apellido: "",
    auto: "",
    fecha: ""
  }

  ngOnInit() {
    this.activatedRouter.queryParams.subscribe(() => {
      let state = this.router.getCurrentNavigation()?.extras.state;
      if (state) {
        this.user.usuario = state['user'].usuario;
        this.user.password = state['user'].password;
        console.log(this.user);
      }
    })
  }

  async guardar(){
    if (this.informacion.nombre != "" && this.informacion.apellido != "" && this.informacion.auto != "" && this.informacion.fecha != "") {
      const alert = await this.alertController.create({
        header: 'Cambio Exitoso.',
        message: 'Se guardaron los cambios realizados.',
        buttons: ['Aceptar'],
      });
      await alert.present();
      localStorage.setItem("Datos", JSON.stringify(this.informacion));
    } else {
      const alert = await this.alertController.create({
        header: 'Formulario incompleto.',
        message: 'Porfavor complete todos los campos.',
        buttons: ['Aceptar'],
      });
      await alert.present();
    }
  }

  salir(){
    this.router.navigate(['home']);
    localStorage.removeItem("Datos");
    this.modal.dismiss(null, 'salir');
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-buttons slot="start">
      <ion-back-button></ion-back-button>
    </ion-buttons>
    <ion-title>LOGIN</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-card class="cont">
    <ion-card-content class="cuerpocard">
      <ion-card-header class="titutlo">
        <ion-card-title>LOGIN</ion-card-title>
      </ion-card-header>
      <div id="container" class="cuerpocard">
        <ion-avatar id="avatar" #avatar>
          <img alt="Silhouette of a person's head"
            src="https://w7.pngwing.com/pngs/132/58/png-transparent-volkswagen-beetle-car-volkswagen-car-mode-of-transport-volkswagen.png" />
        </ion-avatar>
        <h1 id="titulo">
          Bienvenido!
        </h1>
        <ion-label>Usuario: {{user.usuario}}</ion-label><br><br>

        <mat-progress-bar mode="query"></mat-progress-bar>
        <ion-list class="lista" id="formulario">
          <ion-label id="sub">Informacion Adicional</ion-label><br>
          <ion-input  class="input" [(ngModel)]="informacion.nombre" type="text" expand="full" label="Nombre" placeholder="Ingrese Nombre"
            slot="start"></ion-input>
          <ion-input class="input" [(ngModel)]="informacion.apellido" type="text" expand="full" label="Apellido"
            placeholder="Ingrese Apellido" slot="start"></ion-input>
          <ion-select [(ngModel)]="informacion.auto" label="Movilizacion propia:" interface="action-sheet"
            placeholder="Seleccione Opcion" slot="center">
            <ion-select-option value="Noposee">No poseo</ion-select-option>
            <ion-select-option value="Posee">Poseo</ion-select-option>
          </ion-select>
          <ion-input  class="input" [(ngModel)]="informacion.fecha" type="date" expand="full" label="Fecha Nacimiento"
            placeholder="Ingrese Fecha" slot="start">
          </ion-input>
          <mat-progress-bar mode="indeterminate"></mat-progress-bar>

            <ion-button size="medium" slot="start" id="present-alert" (click)="guardar()">
              Guardar
            </ion-button>
            <ion-button size="medium" slot="end" color="danger" (click)="salir()">
              salir
            </ion-button>

        </ion-list>
      </div>
    </ion-card-content>
  </ion-card>
</ion-content>
